akuten.ne.jp/gold/tokka-com/img/img_guide/spacer.gif" width="100%" height="10"></td><td width="15%"><img src="https://www.rakuten.ne.jp/gold/tokka-com/img/img_guide/spacer.gif" width="100%" height="10"></td></tr><tr><td colspan="11" width="100%"><img src="https://www.rakuten.ne.jp/gold/tokka-com/img/img_guide/spacer.gif" width="100%" height="20"></td></tr></table><table border="0" cellspacing="0" cellpadding="0" width="100%"><tr><td colspan="7" width="100%"><img src="https://www.rakuten.ne.jp/gold/tokka-com/img/img_guide/tlt_service.jpg" width="100%"></td></tr><tr><td colspan="7" width="100%"><img src="https://www.rakuten.ne.jp/gold/tokka-com/img/img_guide/spacer.gif" width="100%" height="20"></td></tr><tr><td width="23%"><img src="https://www.rakuten.ne.jp/gold/tokka-com/img/img_guide/btn_service01.jpg" width="100%"></td><td width="2%"><img src="https://www.rakuten.ne.jp/gold/tokka-com/img/img_guide/spacer.gif" width="100%" height="10"></td><td width="23%"><img src="https://www.rakuten.ne.jp/gold/tokka-com/img/img_guide/btn_service02.jpg" width="100%"></td><td width="2%"><img src="https://www.rakuten.ne.jp/gold/tokka-com/img/img_guide/spacer.gif" width="100%" height="10"></td><td width="23%"><img src="https://www.rakuten.ne.jp/gold/tokka-com/img/img_guide/spacer.gif" width="100%" height="10"></td><td width="2%"><img src="https://www.rakuten.ne.jp/gold/tokka-com/img/img_guide/spacer.gif" width="100%" height="10"></td><td width="23%"><img src="https://www.rakuten.ne.jp/gold/tokka-com/img/img_guide/spacer.gif" width="100%" height="10"></td></tr><tr><td colspan="7" width="100%"><img src="https://www.rakuten.ne.jp/gold/tokka-com/img/img_guide/spacer.gif" width="100%" height="20"></td></tr></table><br>■泡パワーでトイレの3大汚れから守る「泡コート」<br>■除菌&抗菌機能と、形状の見直しで、さらに清潔性を向上<br>■節電性が抜群のW瞬間式<br><b>泡の素は、台所用洗剤</b><br>【使用できる洗剤】<br>　・市販の台所用合成洗剤(中性) <br>　※種類の異なる洗剤は混ぜないでください。洗剤が反応して、故障の原因になります。 <br>　※古い洗剤は使用しないでください。泡コートノズルが詰まる原因になります。<br>【使用できない洗剤】<br>　・酸性・アルカリ性・塩素系洗剤 <br>　・ヤシの実洗剤 <br>　・オレンジオイルを含む洗剤 <br>　・柑橘系の香りを有する洗剤 <br>　・アルコールを含む洗剤 <br>　・食洗機用洗剤 <br>　・トイレ用洗剤 <br>　・ジェルタイプの洗剤 <br>　・ハンドソープ・ボディソープ<br>　※天然由来成分を材料としている洗剤は効果が得られません。また、洗剤の成分によっては製品の故障の原因になります。<br><br><b>リモコン</b>：○<br><b>給水方式</b>：水道直結式<br><b>湯沸し方式</b>：W瞬間式<br><b>脱臭方式</b>：触媒<br><b>便座着脱</b>：○<br><b>便座暖房</b>：○<br><b>抗菌樹脂</b>：抗菌樹脂<br><b>便ふたオート開閉</b>：○<br><b>着座センサー</b>：重力スイッチ式<br><b>オート便器洗浄</b>：-<br><b>洗剤使用洗浄</b>：○<br><b>乾燥機能</b>：○<br><b>脱臭機能</b>：○<br><b>マッサージ洗浄機能</b>：○<br><b>ノズルクリーニング機能</b>：○<br><b>ノズル調節</b>：○<br><b>切タイマー</b>：8時間<br><b>電源</b>：AC100V 50-60Hz<br><b>メーカー保証</b>：1年<br><b>寸法</b>：幅 501x高さ 293x奥行 514mm<br><b>質量</b>：約5.5kg<br><b>付属品</b>：<br>　給水ホース分岐金具付95cm<br>　フレキシブルパイプ30cm<br>　取付ボルトセット<br>　クイックファスナー<br>　パッキンセット<br>　説明書セット<br>　スパナ<br>　クッション<br>　リモコンセット<br>　リモコン用取付ねじセット<br>　リモコン用乾電池セット<br>　泡コート操作ガイド<style type="text/css">
